import React from "react";
import { Stack, Box } from "@mui/material";
import { VideoCard } from "./";
// import videoMedia from "../data/videoMedia";

const Videos = (props) => {
  console.log("these are the props", props.videos)
  // const videoyolo =JSON.parse(props.videos.videos)
  return (
    // <Stack direction={"row"} flexWrap="wrap" justifyContent="start" alignItems="start" gap={2}>
    //   {videoMedia.map((item, idx) => (
    //     <Box key={idx}>
    //       {/* {console.log(videoyolo)} */}
    //       {<VideoCard 
    //       id = {item.id}
    //       url = {item.url}
    //       channelTitle = {item.title}
    //       title = {item.title}
    //       image = {item.image}
    //       /> }
    //     </Box>
    //   ))}
    // </Stack>
    <Stack direction={"row"} flexWrap="wrap" justifyContent="start" alignItems="start" gap={2}>
    {props.videos.map((item, idx) => (
      <Box key={idx}>
        {/* {console.log(videoyolo)} */}
        {<VideoCard 
        id = {item.id}
        url = {item.video_path}
        channelTitle = {item.title}
        title = {item.title}
        // image = {item.image}
        /> }
      </Box>
    ))}
  </Stack>
  );
}

export default Videos;
